import {Outlet} from "react-router-dom";

function Header() {
  return (
    <div>
      <header>
        <Link to="/login" className="logo">My Blog</Link>
        <Link to="/register" className="logo">Register</Link>
      </header>
    </div>
  )
}

export default Header
